import React from "react";
import "../styles.css";

const Counter = ({
  value,
  onIncrement,
  onDecrement,
  onIncrementAsync,
  onFetch
}) => {
  //console.log(value);
  return (
    <div>
      <button onClick={onIncrementAsync}>Increment after 1 second</button>{" "}
      <button onClick={onIncrement}>Increment</button>{" "}
      <button onClick={onDecrement}>Decrement</button>
        <a href="something" className={button2} onClick={onFetch}>Fetch by takeEvery</a>
        <a href="something" className="button2" onClick={onFetch}>Fetch by takeLatest</a>
      <hr />
      <div>Clicked: {value.count} times</div>
      <div>{value.rotate ? <div>Wait.......</div> : <div />}</div>
    </div>
  );
};
export default Counter;
